export class Vec2 {
    constructor(row: number, col: number) {
        this.row = row;
        this.col = col;
    }

    row: number;
    col: number;

    isEqual(other: Vec2) {
        return this.row == other.row && this.col == other.col;
    }
}

export const range = (start: number, end: number) =>
    Array.from({length: end - start}, (v, k) => k + start);

export class Obstacle {
    constructor(col: number, height: number, side: boolean) {
        this.col = col;
        this.height = height;
        this.side = side;
    }
    col: number;
    height: number;
    side: boolean;
}
